import React from 'react'

class Form extends React.Component{
    constructor(){
        super()
        this.state = {
            formOutPut : ['inputOneArr', 'inputArrTwo', 'inputArrThree']
        }
    }
    render(){
        return(
                <form>
                    {/* take text from import add to state */}
                    <input type="text"></input>
                    <ui>
                        {/* apply output with map function */}
                        <li>{ this.state.formOutPut[0] }</li>
                        <li>{ this.state.formOutPut[1] }</li>
                        <li>{ this.state.formOutPut[2] }</li>
                    </ui>
                </form>
            )       
    }
}

export default Form
